import React from "react";

const GastoListView = ({ gastos }) => {
  return (
    <div className="max-w-2xl mx-auto mt-10">
      <h2 className="text-2xl font-bold mb-4 text-center">Lista de Gastos</h2>
      <ul className="space-y-2">
        {gastos.map((gasto, index) => (
          <li key={index} className="p-4 bg-gray-100 rounded-xl shadow">
            <p><strong>Concepto:</strong> {gasto.concepto}</p>
            <p><strong>Monto:</strong> ${gasto.monto}</p>
            <p><strong>Fecha:</strong> {gasto.fechaRegistro}</p>
          </li>
        ))}
      </ul>
    </div>
  );
};


export default GastoListView;
